import React, {useState} from 'react';

const SignUp = ()=> {

    // const []

    return(
        <div>
            <h2>Signup</h2>
            <form onSubmit={null}>  
                <label>Email</label>
                <input onChange={null} name="email" type="text" placeholder="enter valid email" />
                <label>UserName</label>
                <input onChange={null} name="username" type="text" placeholder="enter a username" /> &nbsp
                <label>Password</label>
                <input onChange={null} name="password" type="password" placeholder="enter a password" />
                <input type="submit" />
            </form>
        </div>
    )
}

export default SignUp;
